CREATE TABLE `job_estimate_items` (
  `id` int NOT NULL AUTO_INCREMENT,
  `estimate_id` int DEFAULT NULL,
  `assembly_group_id` int DEFAULT NULL,
  `parent_item_id` int DEFAULT NULL,
  `grid_data` json DEFAULT NULL,
  `product_type_id` int DEFAULT NULL COMMENT 'Made nullable for consolidation migration',
  `item_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `item_order` int DEFAULT '0',
  `item_index` int DEFAULT NULL,
  `complexity_score` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
