  `internal_notes` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `multiplier_value` decimal(10,4) DEFAULT NULL COMMENT 'Multiplier value to apply',
  `multiplier_target_lines` text COLLATE utf8mb4_unicode_ci COMMENT 'Target line format',
  `discount_percentage` decimal(5,2) DEFAULT NULL COMMENT 'Discount percentage',
  `discount_flat_amount` decimal(10,2) DEFAULT NULL COMMENT 'Flat discount amount',
  `discount_target_lines` text COLLATE utf8mb4_unicode_ci COMMENT 'Target lines for discount',
  `assembly_start_line` int DEFAULT NULL COMMENT 'Assembly start line ID',
  `text_content` text COLLATE utf8mb4_unicode_ci COMMENT 'Content for text lines',
  PRIMARY KEY (`id`),
  KEY `product_type_id` (`product_type_id`),
  KEY `idx_estimate_id` (`estimate_id`),
  KEY `idx_assembly_group` (`assembly_group_id`),
  KEY `idx_parent_item` (`parent_item_id`),
  KEY `idx_estimate_item_index` (`estimate_id`,`item_index`),
  CONSTRAINT `fk_estimate_items_estimate` FOREIGN KEY (`estimate_id`) REFERENCES `job_estimates` (`id`) ON DELETE CASCADE,
  CONSTRAINT `fk_estimate_items_parent` FOREIGN KEY (`parent_item_id`) REFERENCES `job_estimate_items` (`id`) ON DELETE CASCADE,
  CONSTRAINT `job_estimate_items_ibfk_2` FOREIGN KEY (`product_type_id`) REFERENCES `product_types` (`id`),
  CONSTRAINT `chk_assembly_group_range` CHECK (((`assembly_group_id` is null) or ((`assembly_group_id` >= 0) and (`assembly_group_id` <= 9))))
) ENGINE=InnoDB AUTO_INCREMENT=20566 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
