CREATE TABLE `job_estimates` (
  `id` int NOT NULL AUTO_INCREMENT,
  `job_code` varchar(20) COLLATE utf8mb4_unicode_ci NOT NULL,
  `customer_id` int DEFAULT NULL,
  `job_id` int NOT NULL,
  `version_number` int NOT NULL DEFAULT '1',
  `parent_estimate_id` int DEFAULT NULL,
  `is_draft` tinyint(1) DEFAULT '1',
  `is_active` tinyint(1) NOT NULL DEFAULT '1',
  `finalized_at` timestamp NULL DEFAULT NULL,
  `finalized_by_user_id` int DEFAULT NULL,
  `status` enum('draft','sent','approved','ordered','deactivated') COLLATE utf8mb4_unicode_ci DEFAULT 'draft',
  `subtotal` decimal(10,2) DEFAULT '0.00',
  `tax_rate` decimal(5,4) DEFAULT '0.0000',
  `tax_amount` decimal(10,2) DEFAULT '0.00',
  `total_amount` decimal(10,2) DEFAULT '0.00',
  `notes` text COLLATE utf8mb4_unicode_ci,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `created_by` int DEFAULT NULL,
  `updated_by` int DEFAULT NULL,
  `editing_user_id` int DEFAULT NULL,
  `editing_started_at` timestamp NULL DEFAULT NULL,
  `editing_expires_at` timestamp NULL DEFAULT NULL,
  `editing_locked_by_override` tinyint(1) DEFAULT '0',
  `is_sent` tinyint(1) DEFAULT '0',
  `is_approved` tinyint(1) DEFAULT '0',
  `is_retracted` tinyint(1) DEFAULT '0',
  `qb_estimate_id` varchar(50) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'QuickBooks estimate ID',
  `sent_to_qb_at` timestamp NULL DEFAULT NULL COMMENT 'When estimate was sent to QuickBooks',
  PRIMARY KEY (`id`),
  UNIQUE KEY `job_code` (`job_code`),
  UNIQUE KEY `unique_job_version` (`job_id`,`version_number`),
  KEY `idx_estimate_customer` (`customer_id`),
  KEY `idx_estimate_code` (`job_code`),
  KEY `idx_estimate_status` (`status`),
  KEY `fk_estimates_parent` (`parent_estimate_id`),
  KEY `fk_estimates_editing_user` (`editing_user_id`),
  KEY `idx_qb_estimate_id` (`qb_estimate_id`),
  KEY `idx_is_active` (`is_active`),
  CONSTRAINT `fk_estimates_editing_user` FOREIGN KEY (`editing_user_id`) REFERENCES `users` (`user_id`) ON DELETE SET NULL,
  CONSTRAINT `fk_estimates_job` FOREIGN KEY (`job_id`) REFERENCES `jobs` (`job_id`) ON DELETE CASCADE,
  CONSTRAINT `fk_estimates_parent` FOREIGN KEY (`parent_estimate_id`) REFERENCES `job_estimates` (`id`) ON DELETE SET NULL,
  CONSTRAINT `job_estimates_ibfk_1` FOREIGN KEY (`customer_id`) REFERENCES `customers` (`customer_id`) ON DELETE SET NULL,
  CONSTRAINT `chk_active_has_status` CHECK (((`is_active` = false) or (`is_draft` = true) or (`is_sent` = true) or (`is_approved` = true) or (`is_retracted` = true)))
) ENGINE=InnoDB AUTO_INCREMENT=204 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
