DROP TABLE IF EXISTS `job_invoice_items`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `job_invoice_items` (
  `id` int NOT NULL AUTO_INCREMENT,
  `invoice_id` int NOT NULL,
  `item_category` enum('material','labor','overhead','markup','tax','shipping','other') COLLATE utf8mb4_unicode_ci NOT NULL,
  `item_type` varchar(100) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `item_description` text COLLATE utf8mb4_unicode_ci NOT NULL,
  `item_details` text COLLATE utf8mb4_unicode_ci,
  `quantity` decimal(10,3) DEFAULT '1.000',
  `unit_of_measure` varchar(20) COLLATE utf8mb4_unicode_ci DEFAULT 'ea',
  `unit_price` decimal(10,4) NOT NULL,
  `line_total` decimal(10,2) NOT NULL,
  `internal_cost` decimal(10,4) DEFAULT NULL,
  `margin_percent` decimal(5,2) DEFAULT NULL,
  `margin_amount` decimal(10,2) DEFAULT NULL,
  `estimate_item_id` int DEFAULT NULL,
  `material_requirement_id` int DEFAULT NULL,
  `display_order` int DEFAULT '0',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  KEY `estimate_item_id` (`estimate_item_id`),
  KEY `material_requirement_id` (`material_requirement_id`),
  KEY `idx_invoice_category` (`invoice_id`,`item_category`),
  KEY `idx_display_order` (`invoice_id`,`display_order`),
  CONSTRAINT `job_invoice_items_ibfk_1` FOREIGN KEY (`invoice_id`) REFERENCES `job_invoices` (`id`) ON DELETE CASCADE,
  CONSTRAINT `job_invoice_items_ibfk_2` FOREIGN KEY (`estimate_item_id`) REFERENCES `job_estimate_items` (`id`) ON DELETE SET NULL,
  CONSTRAINT `job_invoice_items_ibfk_3` FOREIGN KEY (`material_requirement_id`) REFERENCES `job_material_requirements` (`id`) ON DELETE SET NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
