--
-- Table structure for table `job_invoices`
--

DROP TABLE IF EXISTS `job_invoices`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `job_invoices` (
  `id` int NOT NULL AUTO_INCREMENT,
  `job_id` int NOT NULL,
  `estimate_id` int DEFAULT NULL,
  `invoice_number` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL,
  `invoice_date` date NOT NULL,
  `due_date` date DEFAULT NULL,
  `customer_id` int DEFAULT NULL,
  `bill_to_name` varchar(255) COLLATE utf8mb4_unicode_ci NOT NULL,
  `bill_to_address` text COLLATE utf8mb4_unicode_ci,
  `ship_to_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `ship_to_address` text COLLATE utf8mb4_unicode_ci,
  `subtotal` decimal(10,2) NOT NULL DEFAULT '0.00',
  `tax_rate` decimal(5,4) DEFAULT '0.0000',
  `tax_amount` decimal(10,2) DEFAULT '0.00',
  `total_amount` decimal(10,2) NOT NULL DEFAULT '0.00',
  `amount_paid` decimal(10,2) DEFAULT '0.00',
  `balance_due` decimal(10,2) GENERATED ALWAYS AS ((`total_amount` - `amount_paid`)) STORED,
  `status` enum('draft','ready','sent','paid','overdue','cancelled') COLLATE utf8mb4_unicode_ci DEFAULT 'draft',
  `job_description` text COLLATE utf8mb4_unicode_ci,
