  KEY `idx_part` (`part_id`),
  KEY `idx_completed` (`completed`),
  KEY `fk_order_tasks_started_by` (`started_by`),
  KEY `idx_order_tasks_assigned_role` (`assigned_role`),
  KEY `idx_order_tasks_depends_on` (`depends_on_task_id`),
  KEY `idx_order_tasks_started_at` (`started_at`),
  CONSTRAINT `fk_order_tasks_depends_on` FOREIGN KEY (`depends_on_task_id`) REFERENCES `order_tasks` (`task_id`) ON DELETE SET NULL,
  CONSTRAINT `fk_order_tasks_started_by` FOREIGN KEY (`started_by`) REFERENCES `users` (`user_id`) ON DELETE SET NULL,
