DROP TABLE IF EXISTS `time_entries`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `time_entries` (
  `entry_id` int NOT NULL AUTO_INCREMENT,
  `user_id` int NOT NULL,
  `clock_in` datetime NOT NULL,
  `clock_out` datetime DEFAULT NULL,
  `break_minutes` int DEFAULT '0',
  `auto_break_minutes` int DEFAULT '0',
  `total_hours` decimal(5,2) DEFAULT '0.00',
  `status` enum('active','completed') COLLATE utf8mb4_unicode_ci DEFAULT 'active',
  `is_deleted` tinyint(1) DEFAULT '0',
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `applied_breaks` json DEFAULT NULL COMMENT 'JSON array of break_ids that were automatically applied',
  `break_adjustment_notes` text COLLATE utf8mb4_unicode_ci COMMENT 'Notes about break calculations (e.g., clocked out during break)',
  `notes` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci COMMENT 'General notes for the time entry',
  `payroll_clock_in` time DEFAULT NULL,
  `payroll_clock_out` time DEFAULT NULL,
  `payroll_break_minutes` int DEFAULT NULL,
  `payroll_total_hours` decimal(5,2) DEFAULT NULL,
  `payroll_adjusted` tinyint(1) DEFAULT '0',
  `is_overtime` tinyint(1) DEFAULT '0',
  `is_holiday` tinyint(1) DEFAULT '0',
  PRIMARY KEY (`entry_id`),
  KEY `idx_user_date` (`user_id`,`clock_in`),
  KEY `idx_status` (`status`),
  CONSTRAINT `time_entries_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`)
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
